('node', 'nieuwsbericht', 0, 6, 6, 'und', 0, 'Een ploeg van het VRT-programma ''Dieren in Nesten'' heeft in Gedinne (Namen) beelden gemaakt van een wolf. Het zou de eerste wolf zijn die in meer dan honderd jaar in onze streken wordt gezien. De beelden werden getoond op het VRT-journaal. Vorige week was er ook al een wolf gespot op de Nederlandse Veluwe.', NULL);
