('node', 'nieuwsbericht', 0, 6, 6, 'und', 0, 'De ploeg van ''Dieren in Nesten'' kwam de wolf toevallig op het spoor. Het team was in de buurt van Gedinne op zoek naar een lynx, een grote katachtige die uitgestorven is in België, maar volgens geruchten opnieuw in onze contreien vertoeft. De ploeg speurde in de zuidelijke Ardennen naar aanwijzingen van de roofkat.\r\n \r\n"Toen we hoorden dat er in en rond Gedinne schapen waren gevonden die gedood waren met een nekbeet, hingen we daar een trailcam op, een soort van video- en fotoval. We hadden gehoopt beelden te vinden van een lynx of verwilderde hond, maar het bleek uiteindelijk om een wolf te gaan", legt presentator Chris Dusauchoit uit.\r\n \r\n"Geen hond"\r\nDe beelden werden getoond aan de Franse wolvenexpert Eric Marboutin. Hij was formeel na het bekijken van de beelden: "Dit is geen hond. Je ziet goed de typische witte markering in zijn gezicht, die anders gevormd is dan bij een husky of een Duitse herdershond. Zijn vacht is donkergrijs op de rug en helderder opzij en onderaan. Ook zijn staart is typisch wolf."\r\n \r\nDe laatste wolf op Belgische grondgebied werd vermoedelijk in 1898 nabij Virton neergeschoten.', NULL);
